import React from "react"

import Header from "./Header"

//componente no React é uma função que retorna um html
function App() {
  let counter = 0

  function increment() {
    counter++
  }
  return (
    <div>
      <Header>Contador: {counter}</Header> // quanto temos html escrito dentro
      do javascript chamamos de JSX (Javascript XML)
      <button>Incrementar</button>
    </div>
  )
}

export default App
